import React from "react";
import { Card, CardActionArea, CardMedia, withStyles } from "@material-ui/core";

import discMania from "../../../images/discmania.png";

const styles = {
  card: {
    width: 175,
    height: 250
  },
  mediaContainer: {
    height: 100
  }
};

export default withStyles(styles)(({ classes }) => {
  return (
    <Card className={classes.card}>
      <CardActionArea>
        <CardMedia title="DiscMania Logo" className={classes.mediaContainer}>
          <img
            src={discMania}
            style={{
              height: "calc(100% - 20px)",
              margin: "10px auto",
              display: "block"
            }}
          />
        </CardMedia>
      </CardActionArea>
    </Card>
  );
});
